import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [loginForm, setLoginForm] = useState({ email: '', password: '' });
  const [contactForm, setContactForm] = useState({ name: '', email: '' });
  const [message, setMessage] = useState('');
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  // Handle login form input change
  const handleLoginChange = (e) => {
    setLoginForm({ ...loginForm, [e.target.name]: e.target.value });
  };

  // Handle contact form input change
  const handleContactChange = (e) => {
    setContactForm({ ...contactForm, [e.target.name]: e.target.value });
  };

  // Login handler
  const handleLoginSubmit = (e) => {
    e.preventDefault();

    // 1. Get CSRF cookie first
    axios.get('http://localhost:8000/sanctum/csrf-cookie', { withCredentials: true })
      .then(() => {
        // 2. Send login request with credentials
        axios.post('http://localhost:8000/api/login', loginForm, { withCredentials: true })
          .then(() => {
            setMessage('Login successful!');
            setIsLoggedIn(true);
          })
          .catch((error) => {
            setMessage('Login failed. Check your credentials.');
            console.error(error);
          });
      });
  };

  // Contact form submit handler
  const handleContactSubmit = (e) => {
    e.preventDefault();

    axios.post('http://localhost:8000/api/contacts', contactForm, {
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      },
      withCredentials: true
    })
      .then(res => {
        setMessage(res.data.message);
        setContactForm({ name: '', email: '' });
      })
      .catch(err => {
        console.error('Full error:', err);
        if (err.response && err.response.data.errors) {
          setMessage(Object.values(err.response.data.errors).join(' '));
        } else if (err.response && err.response.data.message) {
          setMessage(err.response.data.message);
        } else {
          setMessage('Error submitting form');
        }
      });
  };

  return (
    <div style={{ padding: '2rem' }}>
      <h2>Login</h2>
      {!isLoggedIn && (
        <form onSubmit={handleLoginSubmit}>
          <div>
            <label>Email:</label><br />
            <input
              type="email"
              name="email"
              value={loginForm.email}
              onChange={handleLoginChange}
              required
            />
          </div>
          <div>
            <label>Password:</label><br />
            <input
              type="password"
              name="password"
              value={loginForm.password}
              onChange={handleLoginChange}
              required
            />
          </div>
          <button type="submit" style={{ marginTop: '1rem' }}>Login</button>
        </form>
      )}

      {isLoggedIn && (
        <>
          <h2>Contact Form</h2>
          <form onSubmit={handleContactSubmit}>
            <div>
              <label>Name:</label><br />
              <input
                type="text"
                name="name"
                value={contactForm.name}
                onChange={handleContactChange}
                required
              />
            </div>
            <div>
              <label>Email:</label><br />
              <input
                type="email"
                name="email"
                value={contactForm.email}
                onChange={handleContactChange}
                required
              />
            </div>
            <button type="submit" style={{ marginTop: '1rem' }}>Submit Contact</button>
          </form>
        </>
      )}

      {message && <p>{message}</p>}
    </div>
  );
}

export default App;
